--
-- Name: calculate_customer_credit_balance(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calculate_customer_credit_balance(customer_id text) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
DECLARE
  total_amount_due NUMERIC := 0;
  total_returns    NUMERIC := 0;
BEGIN
  -- 1. حساب مبالغ الفواتير غير المدفوعة أو المدفوعة جزئياً أو المتأخرة
  WITH invoice_balances AS (
    SELECT 
      i.id,
      i.total_amount,
      COALESCE(
        SUM(
          CASE 
            WHEN p.type = 'payment' THEN p.amount 
            ELSE -p.amount 
          END
        ), 0
      ) AS total_paid
    FROM invoices i
    LEFT JOIN payments p ON i.id = p.invoice_id
    WHERE i.customer_id = customer_id
      AND i.status IN (
        'غير مدفوع',       -- غير مدفوع
        'مدفوع جزئياً',    -- مدفوع جزئياً
        'متأخر'            -- متأخر
      )
    GROUP BY i.id, i.total_amount
  )
  SELECT COALESCE(SUM(total_amount - total_paid), 0)
    INTO total_amount_due
  FROM invoice_balances;

  -- 2. طرح مبالغ المرتجعات المعتمدة
  SELECT COALESCE(SUM(total_amount), 0)
    INTO total_returns
  FROM returns
  WHERE customer_id = customer_id
    AND status = 'approved';  -- approved

  -- 3. إرجاع الرصيد المالي النهائي
  RETURN total_amount_due - total_returns;
END;
$$;


