--
-- Name: calculate_customer_points_balance(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.calculate_customer_points_balance(customer_id text) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
  is_eligible     BOOLEAN;
  total_earned    INTEGER;
  total_redeemed  INTEGER;
BEGIN
  -- 1. التحقق من أهلية العميل لكسب النقاط
  SELECT earn_points_enabled
    INTO is_eligible
  FROM customers
  WHERE id = customer_id;

  IF NOT is_eligible THEN
    RETURN 0;
  END IF;

  -- 2. حساب النقاط المكتسبة من الفواتير ذات الحالة "مدفوع"
  SELECT COALESCE(SUM(points_earned), 0)
    INTO total_earned
  FROM invoices
  WHERE customer_id = customer_id
    AND status = 'مدفوع';

  -- 3. حساب النقاط المستبدلة من عمليات الاسترداد المكتملة (status = 'completed')
  SELECT COALESCE(SUM(total_points_redeemed), 0)
    INTO total_redeemed
  FROM redemptions
  WHERE customer_id = customer_id
    AND status = 'completed';

  -- 4. إرجاع الفرق
  RETURN total_earned - total_redeemed;
END;
$$;


ALTER FUNCTION public.calculate_customer_points_balance(customer_id text) OWNER TO postgres;

--
-- Name: get_business_type_distribution(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_business_type_distribution() RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
  result JSON;
BEGIN
  SELECT COALESCE(json_agg(row_to_json(distribution)), '[]'::JSON)
  INTO result
  FROM (
    SELECT 
      business_type AS "businessType",
      COUNT(*)      AS count,
      ROUND((COUNT(*) * 100.0 / (SELECT COUNT(*) FROM customers)), 1) AS percentage
    FROM customers
    GROUP BY business_type
    ORDER BY count DESC
  ) distribution;

  RETURN result;
END;
$$;


