--
-- Name: get_churn_risk_customers(integer, integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_churn_risk_customers(p_page_index integer, p_page_size integer, p_inactive_days integer DEFAULT 90) RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
  result      JSON;
  total_count INT;
BEGIN
  -- 1. إجمالي عدد العملاء المعرضين للخطر
  SELECT COUNT(*) INTO total_count
  FROM customers c
  LEFT JOIN (
    SELECT customer_id, MAX(date) AS last_activity
    FROM invoices
    GROUP BY customer_id
  ) i ON c.id = i.customer_id
  WHERE i.last_activity IS NULL
     OR i.last_activity < (CURRENT_DATE - p_inactive_days);

  -- 2. بناء وإرجاع هيكل JSON
  SELECT json_build_object(
    'items', (
      SELECT json_agg(row_to_json(churn_risk))
      FROM (
        SELECT 
          c.id,
          c.name,
          c.business_type   AS "businessType",
          c.phone,
          COALESCE(i.last_activity, c.created_at) AS "lastActivity",
          EXTRACT(
            DAY 
            FROM (CURRENT_DATE - COALESCE(i.last_activity, c.created_at))
          )::INT                           AS "inactiveDays"
        FROM customers c
        LEFT JOIN (
          SELECT customer_id, MAX(date) AS last_activity
          FROM invoices
          GROUP BY customer_id
        ) i ON c.id = i.customer_id
        WHERE i.last_activity IS NULL
           OR i.last_activity < (CURRENT_DATE - p_inactive_days)
        ORDER BY "inactiveDays" DESC
        LIMIT p_page_size
        OFFSET p_page_index * p_page_size
      ) churn_risk
    ),
    'total', total_count
  ) INTO result;

  RETURN result;
END;
$$;


