--
-- Name: get_customer_rfm_analysis(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_customer_rfm_analysis(p_page_index integer, p_page_size integer) RETURNS json
    LANGUAGE plpgsql
    AS $$
DECLARE
  result      JSON;
  total_count INT;
BEGIN
  -- 1. حساب إجمالي عدد العملاء
  SELECT COUNT(*) INTO total_count FROM customers;

  -- 2. إنشاء CTE لتحليل RFM
  WITH customer_invoices AS (
    SELECT 
      c.id,
      c.name,
      c.business_type,
      COUNT(i.id) AS frequency,
      COALESCE(SUM(i.total_amount), 0) AS monetary,
      MAX(i.date) AS last_purchase_date,
      CASE 
        WHEN MAX(i.date) IS NOT NULL THEN 
          EXTRACT(DAY FROM (CURRENT_DATE - MAX(i.date)))::INT
        ELSE NULL
      END AS recency
    FROM customers c
    LEFT JOIN invoices i ON c.id = i.customer_id
    GROUP BY c.id, c.name, c.business_type
  )

  -- 3. بناء وإرجاع هيكل JSON
  SELECT json_build_object(
    'items', (
      SELECT json_agg(row_to_json(ci))
      FROM (
        SELECT 
          id,
          name,
          business_type AS "businessType",
          frequency,
          monetary,
          recency,
          last_purchase_date AS "lastPurchase"
        FROM customer_invoices
        ORDER BY monetary DESC, frequency DESC
        LIMIT p_page_size
        OFFSET p_page_index * p_page_size
      ) ci
    ),
    'total', total_count
  ) INTO result;

  RETURN result;
END;
$$;


