--
-- Name: get_customers_with_balances(integer, integer, text, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_customers_with_balances(p_page_index integer, p_page_size integer, p_search_term text DEFAULT ''::text, p_business_type text DEFAULT ''::text, p_sort_by text DEFAULT 'name'::text, p_sort_dir text DEFAULT 'asc'::text) RETURNS json
    LANGUAGE plpgsql
    AS $_$
DECLARE
  v_from         INTEGER;
  v_count        INTEGER;
  v_where_clause TEXT := '';
  v_order_clause TEXT := '';
  v_query        TEXT;
  v_count_query  TEXT;
  v_result       JSON;
BEGIN
  -- حساب الإزاحة
  v_from := p_page_index * p_page_size;

  -- شرط البحث
  IF p_search_term <> '' THEN
    v_where_clause := v_where_clause ||
      format(
        ' AND (c.name ILIKE ''%%%s%%'' OR c.phone ILIKE ''%%%s%%'' OR c.contact_person ILIKE ''%%%s%%'')',
        p_search_term, p_search_term, p_search_term
      );
  END IF;

  -- فلتر نوع النشاط التجاري
  IF p_business_type <> '' AND p_business_type <> 'all' THEN
    v_where_clause := v_where_clause ||
      format(' AND c.business_type = ''%s''', p_business_type);
  END IF;

  -- شرط الترتيب
  IF p_sort_dir = 'asc' THEN
    v_order_clause := format(' ORDER BY c.%I ASC', p_sort_by);
  ELSE
    v_order_clause := format(' ORDER BY c.%I DESC', p_sort_by);
  END IF;

  -- حساب إجمالي السجلات
  v_count_query := 'SELECT COUNT(*) FROM customers c WHERE 1=1' || v_where_clause;
  EXECUTE v_count_query INTO v_count;

  -- بناء الاستعلام الرئيسي
  v_query := format($f$
    SELECT json_build_object(
      'items', COALESCE(json_agg(
        json_build_object(
          'id',                 c.id,
          'name',               c.name,
          'phone',              c.phone,
          'contact_person',     c.contact_person,
          'business_type',      c.business_type,
          'credit_balance',     c.credit_balance,
          'current_points',     c.current_points,
          'points_earned',      c.points_earned,
          'points_redeemed',    c.points_redeemed,
          'earn_points_enabled',c.earn_points_enabled
        )
      ), '[]'::json),
      'total', %s
    )
    FROM customers c
    WHERE 1=1 %s %s
    LIMIT %s OFFSET %s
  $f$, v_count, v_where_clause, v_order_clause, p_page_size, v_from);

  -- تنفيذ وإرجاع النتيجة
  EXECUTE v_query INTO v_result;
  RETURN v_result;
END;
$_$;


ALTER FUNCTION public.get_customers_with_balances(p_page_index integer, p_page_size integer, p_search_term text, p_business_type text, p_sort_by text, p_sort_dir text) OWNER TO postgres;

--
-- Name: get_paginated_invoices(integer, integer, text, text, text, text, text, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_paginated_invoices(p_page_index integer, p_page_size integer, p_search_term text DEFAULT ''::text, p_status_filter text DEFAULT ''::text, p_date_from text DEFAULT ''::text, p_date_to text DEFAULT ''::text, p_sort_by text DEFAULT 'date'::text, p_sort_dir text DEFAULT 'desc'::text) RETURNS json
    LANGUAGE plpgsql
    AS $_$
DECLARE
  v_from         INTEGER;
  v_count        INTEGER;
  v_where_clause TEXT := '';
  v_order_clause TEXT := '';
  v_query        TEXT;
  v_count_query  TEXT;
  v_result       JSON;
BEGIN
  -- حساب الإزاحة
  v_from := p_page_index * p_page_size;

  -- شرط البحث
  IF p_search_term <> '' THEN
    IF p_search_term ~ '^[0-9]+$' THEN
      v_where_clause := v_where_clause ||
        format(
          ' AND (i.id ILIKE ''%%%s%%'' OR i.customer_id ILIKE ''%%%s%%'' OR c.phone ILIKE ''%%%s%%'')',
          p_search_term, p_search_term, p_search_term
        );
    ELSE
      v_where_clause := v_where_clause ||
        format(
          ' AND (i.id ILIKE ''%%%s%%'' OR c.name ILIKE ''%%%s%%'' OR c.contact_person ILIKE ''%%%s%%'')',
          p_search_term, p_search_term, p_search_term
        );
    END IF;
  END IF;

  -- فلتر الحالة
  IF p_status_filter <> '' AND p_status_filter <> 'all' THEN
    v_where_clause := v_where_clause || format(' AND i.status = ''%s''', p_status_filter);
  END IF;

  -- فلتر التواريخ
  IF p_date_from <> '' THEN
    v_where_clause := v_where_clause || format(' AND i.date >= ''%s''', p_date_from);
  END IF;
  IF p_date_to <> '' THEN
    v_where_clause := v_where_clause || format(' AND i.date <= ''%s''', p_date_to);
  END IF;

  -- شرط الترتيب
  IF p_sort_dir = 'asc' THEN
    v_order_clause := format(' ORDER BY i.%I ASC', p_sort_by);
  ELSE
    v_order_clause := format(' ORDER BY i.%I DESC', p_sort_by);
  END IF;

  -- حساب إجمالي السجلات
  v_count_query := 'SELECT COUNT(*) FROM invoices i JOIN customers c ON i.customer_id = c.id WHERE 1=1' 
                   || v_where_clause;
  EXECUTE v_count_query INTO v_count;

  -- بناء الاستعلام الرئيسي
  v_query := format($f$
    SELECT json_build_object(
      'items', COALESCE(json_agg(
        json_build_object(
          'id',               i.id,
          'customer_id',      i.customer_id,
          'date',             i.date,
          'due_date',         i.due_date,
          'total_amount',     i.total_amount,
          'points_earned',    i.points_earned,
          'points_redeemed',  i.points_redeemed,
          'status',           i.status,
          'payment_method',   i.payment_method,
          'categories_count', i.categories_count,
          'customer', json_build_object(
            'id',             c.id,
            'name',           c.name,
            'phone',          c.phone,
            'contact_person', c.contact_person
          )
        )
      ), '[]'::json),
      'total', %s
    )
    FROM invoices i
    JOIN customers c ON i.customer_id = c.id
    WHERE 1=1 %s %s
    LIMIT %s OFFSET %s
  $f$, v_count, v_where_clause, v_order_clause, p_page_size, v_from);

  -- تنفيذ وإرجاع النتيجة
  EXECUTE v_query INTO v_result;
  RETURN v_result;
END;
$_$;


