--
-- Name: recalc_customer_credit_balances(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.recalc_customer_credit_balances() RETURNS void
    LANGUAGE sql
    AS $$
  WITH
    inv AS (
      SELECT 
        customer_id,
        SUM(total_amount) AS total_invoices
      FROM invoices
      GROUP BY customer_id
    ),
    pay AS (
      SELECT 
        customer_id,
        SUM(amount) AS total_payments
      FROM payments
      GROUP BY customer_id
    )
  UPDATE customers c
  SET credit_balance =
    COALESCE(c.opening_balance, 0)
    + COALESCE(inv.total_invoices, 0)
    - COALESCE(pay.total_payments, 0)
  FROM inv
  FULL JOIN pay USING (customer_id)
  WHERE c.id = COALESCE(inv.customer_id, pay.customer_id);
$$;


