--
-- Name: update_customer_balances(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_customer_balances(p_customer_id text) RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
  points_balance   INTEGER;
  credit_balance   NUMERIC;
  total_earned     INTEGER;
  total_redeemed   INTEGER;
BEGIN
  -- 1. احسب الرصيد الحالي للنقاط
  points_balance := calculate_customer_points_balance(p_customer_id);

  -- 2. احسب الرصيد المالي
  credit_balance := calculate_customer_credit_balance(p_customer_id);

  -- 3. احسب إجمالي النقاط المكتسبة (status = 'مدفوع')
  SELECT COALESCE(SUM(points_earned), 0)
    INTO total_earned
  FROM invoices
  WHERE customer_id = p_customer_id
    AND status = 'مدفوع';

  -- 4. احسب إجمالي النقاط المستبدلة (status = 'completed')
  SELECT COALESCE(SUM(total_points_redeemed), 0)
    INTO total_redeemed
  FROM redemptions
  WHERE customer_id = p_customer_id
    AND status = 'completed';

  -- 5. حدّث جدول customers بالقيم المحسوبة
  UPDATE customers
  SET
    current_points   = points_balance,
    points_earned    = total_earned,
    points_redeemed  = total_redeemed,
    credit_balance   = credit_balance
  WHERE id = p_customer_id;
END;
$$;


ALTER FUNCTION public.update_customer_balances(p_customer_id text) OWNER TO postgres;

